import React from 'react';
import './App.css';
import { Login, Register, Welcome } from "./components/login/index";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router>
        <Routes/>
      </Router>
    </div>
    );

}

const Routes = () => {
  return(
    <Switch>
      <Route  component={Login}/>
    </Switch>
  )
}

export default App;
